import React from "react";

const DEFAULT_PLACEHOLDER_IMAGE =
    "https://m.media-amazon.com/images/M/MV5BMTczNTI2ODUwOF5BMl5BanBnXkFtZTcwMTU0NTIzMw@@._V1_SX300.jpg";

const Movie = ({ Paid }) => {
    const image =
        Paid.imageURl === "N/A" ? DEFAULT_PLACEHOLDER_IMAGE : Paid.imageURl;
    return (
        <div className="Paid">
            <h2>{Paid.confName}</h2>
            <div>
                <img
                    width="200"
                    alt={`The movie titled: ${Paid.confName}`}
                    src={image}
                />
            </div>
            <p>({Paid.confStartDate})</p>
        </div>
    );
};

export default Movie;
